					["custom"] = "if MDT and MDT:GetCurrentPreset() then \n    aura_env.SetMDTPull(1)\nend",
					["do_custom"] = true,
				},
				["init"] = {
					["custom"] = "\naura_env.SetMDTPull = function(pullNumber)\n    MDT:GetCurrentPreset().value.currentPull = pullNumber\n    MDT:GetCurrentPreset().value.selection = { pullNumber }            \n    MDT:DungeonEnemies_UpdateSelected(pullNumber)\nend\n\naura_env.getSteps = function()\n    return select(3, C_Scenario.GetStepInfo())\nend\n\n\naura_env.isDungeonFinished = function()\n    return (aura_env.getSteps() and aura_env.getSteps() < 1)\nend\n\naura_env.isMythicPlus = function()\n    local difficulty = select(3, GetInstanceInfo()) or -1\n    if difficulty == 8 and not aura_env.isDungeonFinished() then\n        return true\n    else\n        return false\n    end\nend\n\n\naura_env.getProgressInfo = function()\n    if aura_env.isMythicPlus() then\n        local numSteps = select(3, C_Scenario.GetStepInfo())\n        if numSteps and numSteps > 0 then\n            local info = {C_Scenario.GetCriteriaInfo(numSteps)}\n            if info[13] == true then\n                return info\n            end\n        end\n    end\nend\n\naura_env.getMaxQuantity = function()\n    local progInfo = aura_env.getProgressInfo()\n    if progInfo then        \n        return progInfo[5]\n    end\nend\n\naura_env.getCurrentQuantity = function()\n    local progInfo = aura_env.getProgressInfo()\n    if progInfo then  \n        return strtrim(progInfo[8], \"%\")\n    end\nend\n\n\naura_env.getEnemyForcesProgress = function()\n    return aura_env.getForcePercentForEnemyCount(aura_env.getCurrentQuantity())\nend\n\naura_env.getForcePercentForEnemyCount = function(quantity)\n    local maxQuantity = aura_env.getMaxQuantity()\n    if not maxQuantity then\n        return 100\n    end\n    \n    local progress = quantity / maxQuantity\n    return progress * 100\nend",
