			["customText"] = "function()\n    aura_env.last_stepSize = aura_env.last_stepSize or 0\n    aura_env.last_currentProg = aura_env.last_currentProg or 0\n    aura_env.last_unitsLeftInStep = aura_env.last_unitsLeftInStep or 0\n    local currentPull = MDT:GetCurrentPull() or 1\n    if not aura_env.last or aura_env.last < GetTime() - 1 then\n        aura_env.last = GetTime()\n        aura_env.last_stepSize = aura_env.getForcePercentForEnemyCount(MDT:CountForces(currentPull))\n        aura_env.last_currentProg = aura_env.getEnemyForcesProgress()\n        aura_env.last_unitsLeftInStep = aura_env.last_stepSize - aura_env.last_currentProg\n        local max_pulls = #MDT:GetCurrentPreset().value.pulls or 0\n        \n        if aura_env.config[\"autoPull\"] \n        and aura_env.isMythicPlus()\n        and aura_env.last_unitsLeftInStep <= 0 \n        and currentPull < max_pulls then\n            currentPull = currentPull + 1\n            aura_env.SetMDTPull(currentPull)\n        end\n        \n    end    \n    return currentPull, \n    format(\"%.2f\",aura_env.last_stepSize), \n    format(\"%.2f\",aura_env.last_currentProg), \n    format(\"%.2f\",aura_env.last_unitsLeftInStep)\nend\n\n\n",
