					["custom"] = "local region = aura_env.region\nlocal plate = C_NamePlate.GetNamePlateForUnit('nameplate'..aura_env.cloneId)\nif plate then\n    region:ClearAllPoints()\n    local anchor = aura_env.GetAnchorPoint()\n    local xOffset = aura_env.config[\"xOffset\"] or 0\n    local yOffset = aura_env.config[\"yOffset\"] or 0\n    region:SetPoint(aura_env.GetAnchorComplement(anchor), plate, anchor, xOffset, yOffset)    \nend\n\n\n",
					["do_custom"] = false,
				},
				["init"] = {
					["custom"] = "aura_env.GetAnchorPoint = function()   \n    local anchorSelection = aura_env.config[\"anchor\"]    \n    if anchorSelection == 2 then\n        return \"RIGHT\"\n    end\n    if anchorSelection == 3 then\n        return \"BOTTOM\"            \n    end\n    \n    if anchorSelection == 4 then\n        return \"LEFT\"\n    end \n    return \"TOP\"\nend\n\n\naura_env.GetAnchorComplement = function(point)       \n    if point == \"RIGHT\" then\n        return \"LEFT\"\n    end\n    if point == \"BOTTOM\" then\n        return \"TOP\"            \n    end\n    \n    if point == \"LEFT\" then\n        return \"RIGHT\"\n    end \n    return \"BOTTOM\"\nend\n\naura_env.spairs = function(t, order)\n    -- collect the keys\n    local keys = {}\n    for k in pairs(t) do keys[#keys+1] = k end\n    \n    -- if order function given, sort by it by passing the table and keys a, b,\n    -- otherwise just sort the keys \n    if order then\n        table.sort(keys, function(a,b) return order(t, a, b) end)\n    else\n        table.sort(keys)\n    end\n    \n    -- return the iterator function\n    local i = 0\n    return function()\n        i = i + 1\n        if keys[i] then\n            return keys[i], t[keys[i]]\n        end\n    end\nend\n\naura_env.GetCurrentPullNpcList = function ()\n    local pull = aura_env.GetCurrentPull()\n    local db = MDT:GetDB()\n    local ret = {}\n    local retIndex = 1\n    if pull then\n        for enemyIdx,clones in pairs(pull) do\n            if tonumber(enemyIdx) then\n                if MDT.dungeonEnemies[db.currentDungeonIdx][enemyIdx] then\n                    local npcID = MDT.dungeonEnemies[db.currentDungeonIdx][enemyIdx][\"id\"]\n                    for _,_ in pairs(clones) do\n                        ret[retIndex] = npcID\n                        retIndex = retIndex + 1\n                    end                    \n                end\n            end\n        end\n    end \n    return ret\nend\n\naura_env.GetCurrentPull = function()\n    local idx = MDT:GetCurrentPull() or 1\n    local preset = MDT:GetCurrentLivePreset() or MDT:GetCurrentPreset()\n    local pulls = MDT:GetPulls(preset)\n    \n    if pulls[idx] then\n        aura_env.currentPull = pulls[idx]\n    end\n    return aura_env.currentPull       \nend\n\n\n\naura_env.NameplatesToHighlight = function()\n    local npcIDs = aura_env.GetCurrentPullNpcList()\n    local ret = {}\n    local retIdx = 1\n    local nameplateMap = {}\n    for i = 1, 40 do\n        local unit = \"nameplate\"..i\n        if UnitExists(unit) and not UnitIsFriend(\"player\", unit) then\n            nameplateMap[unit] = aura_env.harmDistance(unit)\n        end\n    end    \n    for unit,_ in aura_env.spairs(nameplateMap, function(t,a,b) return t[b] > t[a] end) do\n        local guid = UnitGUID(unit)\n        local _,_,_,_,_,npc_id,_ = strsplit(\"-\",guid)        \n        for k, npcId in pairs(npcIDs) do\n            if npc_id == tostring(npcId) then\n                ret[retIdx] = unit\n                retIdx = retIdx + 1\n                npcIDs[k] = nil\n                break \n            end                \n        end\n    end\n    return ret\nend\n\naura_env.harmDistance = function(unit)\n    local output = 100\n    for _, v in pairs(aura_env.HarmItems) do\n        if IsItemInRange(v.id, unit) then\n            output = v.text\n            break\n        end\n    end\n    return output\nend\n\n\naura_env.HarmItems = {\n    {\n        id = 37727,\n        text = 2\n    },\n    {\n        id = 63427,\n        text = 5\n    },\n    {\n        id = 34368,\n        text = 6\n    },\n    {\n        id = 32321,\n        text = 8\n    },\n    {\n        id = 33069,\n        text = 10\n    },\n    {\n        id = 10645,\n        text = 15\n    },\n    {\n        id = 31463,\n        text = 20\n    },\n    {\n        id = 34191,\n        text = 25\n    },\n    {\n        id = 24269,\n        text = 30\n    },\n    {\n        id = 28767,\n        text = 35\n    },\n    {\n        id = 23836,\n        text = 40\n    },\n    {\n        id = 116139,\n        text = 45\n    },\n    {\n        id = 32825,\n        text = 50\n    },\n    {\n        id = 41265,\n        text = 60\n    },\n    {\n        id = 35278,\n        text = 70\n    },\n    {\n        id = 33119,\n        text = 80\n    },\n}\n\n\n\n\n\n\n",
